node.text:
E assim chegamos aos 100 mil inscritos no @youtube com o canal Papo de Bolsa!

Em um pouco mais de um ano muitas coisas aconteceram, desde um canal ser criado como um plano B, até ele ganhar corpo e virar meu plano A, ao qual despendo horas e horas prazeirosamente todos os dias.

Não estive sozinha em nenhum momento nessa jornada, até mesmo quando eu tinha que dar conta de tudo, desde gravar, editar, gerar conteúdo etc sempre tive minha família, meu amor @_rafaelpaim_ e amigos que em nenhum segundo titubearam em pensar em me apoiar e ajudar. Sou grata à cada um de vocês!

Sou grata à todos que me ajudam nos bastidores (@taci_fonseca , @cambarcelos @alissonczbasso), sejam com tarefas que hoje consigo delegar, até quem me ajuda a obter mais conhecimento todos os dias!

Não posso deixar de agradecer os parceiros do canal (@clearcorretora , @levante.investimentos , @trademap ) que ajudam ele ser a empresa que é, que se mantem ativo e sempre buscando melhorar, porque sim! Para quem acha que criar um canal é tarefa simples, saibam que precisamos de planejamento, administração, saldar nossas obrigações assim como qualquer outra empresa!

Mesmo com o canal pequenininho, ele chamou a atenção de algumas pessoas as quais estenderam a mão e sempre me ajudaram desde então. Obrigada à todos vocês que me permitiram seguir no mesmo caminho que vocês de educar e gerar conteúdo e que faço questão de citar aqui por saber que sempre pude contar e ainda poderei, afinal o canal tem muito para crescer e eu tenho muito à evoluir! Obrigada, obrigada e obrigada!

